exports=async function(url,bid,cid,options){const{parseContent}=await require("transcode/parse_content");return parseContent(url,null,{clientOptions:{...(options&&options.clientOptions)},preprocess:h=>h.subIndexOf(/id="txt"[^>]*>/).toIndexOf("</div>").subRegexMapAll(/<dd [^>]*data-id="(?<sort>\d+)"[^>]*>(?<p>(?:<\/?p[^>]*>|<br\s*\/?>|[^<])+)<\/dd>/g).map(_=>(_.sort=parseInt(_.sort),_)).sort((a,b)=>a.sort-b.sort).filter(_=>999>_.sort).map(_=>_.p).join("\n")})};